import styled from "styled-components";

export const DetailWrapper = styled.div`
    width: 620px;
    margin: 0px auto;
    // background: red;  
`;

export const Title = styled.div`
    width: 100%;
    margin: 30px 0px;
    text-align: center;
    font-size: 34px;
    color: #333333;
    font-weight: bold;
`;

export const Content = styled.div`
    color:#2f2f2f;
    font-size: 16px;
    line-height: 30px;
`;
